import React, { useEffect, useState } from 'react';

import {
  StyleSheet,
  View,
  Text,
  TouchableOpacity,
  Platform,
} from 'react-native';
// import {
//   configure,
//   getDeviceId,
//   registerFace,
//   startLiveNess,
// } from './livenessModule';

// import LivenessView from './livenessModule/LivenessView';
import {
  configure,
  getDeviceId,
  registerFace,
  startLiveNess,
  LivenessView,
} from 'liveness-rn';

const imageData =
  '';

export default function App() {
  const [status, setStatus] = useState(false);
  useEffect(() => {
    let appId = 'com.qts.test';
    configure(appId);
  }, []);

  const onStartLiveNess = () => {
    if (Platform.OS === 'ios') {
      setStatus(true);
    } else {
      startLiveNess((data) => {
        console.log('startLiveNess', data);
      });
    }
  };

  const onGetDeviceID = () => {
    getDeviceId((data) => {
      console.log('onGetDeviceID', data);
    });
  };

  const onRegisterFace = () => {
    registerFace(imageData, (data) => {
      if (Platform.OS === 'ios') {
        console.log('onRegisterFace', data);
      } else {
        console.log('onRegisterFace', data);
      }
    });
  };


  return (
    <View style={styles.container}>
      {status && (
        <View style={styles.view_camera}>
          <LivenessView
            style={styles.view_liveness}
            onEvent={(data: any) => {
              console.log('===sendEvent===', data.nativeEvent?.data);
            }}
            onDidFinish={(data: any) => {
              console.log('===onDidFinish===', data.nativeEvent?.data);
            }}
            requestid={'requestid'}
          />
        </View>
      )}
      <TouchableOpacity onPress={onStartLiveNess} style={styles.btn_liveness}>
        <Text>Start LiveNess</Text>
      </TouchableOpacity>
      <TouchableOpacity
        onPress={onGetDeviceID}
        style={styles.btn_register_face}
      >
        <Text>get Device ID</Text>
      </TouchableOpacity>
      <TouchableOpacity
        onPress={onRegisterFace}
        style={styles.btn_register_face}
      >
        <Text>Start Register Face</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  view_camera: {
    width: '100%',
    height: 400,
    backgroundColor: 'red',
    marginBottom: 24,
  },
  view_liveness: {
    flex: 1,
  },
  btn_liveness: {
    padding: 10,
    backgroundColor: '#c0c0c0',
    width: '90%',
    justifyContent: 'center',
    alignItems: 'center',
    borderRadius: 12,
    marginBottom: 24,
  },
  btn_register_face: {
    padding: 10,
    backgroundColor: '#c0c0c0',
    width: '90%',
    justifyContent: 'center',
    alignItems: 'center',
    borderRadius: 12,
    marginBottom: 24,
  },
});
